import "./Header.css";

const Header = () => {
  return (
    <header className="header">
      <img
        src="https://chatx.ai/wp-content/uploads/2023/02/logo_design_A_stylized_letter_M-bf564564-45a4-4bf2-81a6-1054545a45c65-1024x1024.jpg.webp"
        alt="header picture"
      />
    </header>
  );
};

export default Header;
